import React from "react";
import Home from "./layout/Home";
import DarkLightTheme from "./contexts/Context";
import "./App.css";
function App() {
  return (
    <div className="App">
      <DarkLightTheme>
        <Home/>
      </DarkLightTheme>
    </div>
  );
}

export default App;
